There is a review at cinefemale but I won't bore you with it!

This movie is a must-see for those who desire a behind-the-scenes look at porn, plain and simple. The traditionally uncomplicated way of filming as part of the european experience, comes through in this raw footage collected from porn shoots. You are often-times, sitting behind the man with the camera, getting an overall view.

Unlike the dopey, p.c. brainwashed review at cinefemale, I thought this provided an accurate view and there was no-one being manipulated, as she pretends to castigate - as if there is such a thing as slavery being shown!

I am content that everyone shown was filming for reasons of desire, concious or otherwise; some people just like to be in front of a camera!

Enjoy.
